RoboCop is a 1987 American science fiction-action film directed by Paul Verhoeven. Set in a crime-ridden Detroit, Michigan in the near future, RoboCop centers on a police officer who is brutally murdered and subsequently re-created as a super-human cyborg known as &quot;RoboCop&quot;. The film features Peter Weller, Dan O'Herlihy, Kurtwood Smith, Nancy Allen, Miguel Ferrer, and Ronny Cox.

Documentary about the making of Paul Verhoeven's American film debut film
